import React, { useState } from "react";
import "./App.css";

function App() {
  const [query, setQuery] = useState("");
  const [mode, setMode] = useState("lexical"); // Default: lexical
  const [results, setResults] = useState([]);
  const [total, setTotal] = useState(0);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // 검색 요청 함수
  const handleSearch = async () => {
    if (!query) {
      setError("Please enter a search query.");
      return;
    }
    setLoading(true);
    setError("");
    setResults([]);
    setTotal(0);

    try {
      const response = await fetch("http://localhost:3000/search", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ query, mode }),
      });
      const data = await response.json();

      if (response.ok) {
        setResults(data.results);
        setTotal(data.total);
      } else {
        setError(data.error || "An error occurred while searching.");
      }
    } catch (err) {
      setError("Failed to connect to the server.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Movie Search</h1>
        <div className="search-container">
          <input
            type="text"
            placeholder="Enter your search query..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="search-box"
          />
          <div className="search-modes">
            <label>
              <input
                type="radio"
                value="lexical"
                checked={mode === "lexical"}
                onChange={(e) => setMode(e.target.value)}
              />
              Lexical Search
            </label>
            <label>
              <input
                type="radio"
                value="vector"
                checked={mode === "vector"}
                onChange={(e) => setMode(e.target.value)}
              />
              Vector Search
            </label>
            <label>
              <input
                type="radio"
                value="hybrid"
                checked={mode === "hybrid"}
                onChange={(e) => setMode(e.target.value)}
              />
              Hybrid Search
            </label>
          </div>
          <button onClick={handleSearch} disabled={loading} className="search-button">
            {loading ? "Searching..." : "Search"}
          </button>
        </div>
        {error && <div className="error">{error}</div>}
        <div className="results-container">
          <h2>Search Results</h2>
          {total > 0 && <p>Total Results: {total}</p>}
          {results.length > 0 && (
            <table className="results-table">
              <thead>
                <tr>
                  <th>Title</th>
                  <th>Plot</th>
                  <th>Full Plot</th>
                  <th>Similarity / Score</th>
                </tr>
              </thead>
              <tbody>
                {results.map((result) => (
                  <tr key={result._id}>
                    <td>{result.title}</td>
                    <td>{result.plot || "N/A"}</td>
                    <td>{result.fullplot || "N/A"}</td>
                    <td>
                      {result.similarity !== undefined
                        ? result.similarity.toFixed(4)
                        : result.score !== undefined
                        ? result.score.toFixed(4)
                        : "N/A"}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </header>
    </div>
  );
}

export default App;
